var SK="dcr_hub";
var fa=0,lu=0;
function b2b(s){var b=atob(s),u=new Uint8Array(b.length);for(var i=0;i<b.length;i++)u[i]=b.charCodeAt(i);return u.buffer}
async function dec(pw){
  try{
    var e=new TextEncoder(),km=await crypto.subtle.importKey("raw",e.encode(pw),"PBKDF2",false,["deriveKey"]);
    var k=await crypto.subtle.deriveKey({name:"PBKDF2",salt:b2b(D.s),iterations:D.n,hash:"SHA-256"},km,{name:"AES-GCM",length:256},true,["decrypt"]);
    var p=await crypto.subtle.decrypt({name:"AES-GCM",iv:b2b(D.v)},k,b2b(D.c));
    var kx=await crypto.subtle.exportKey("raw",k);
    return{h:new TextDecoder().decode(p),k:btoa(String.fromCharCode(...new Uint8Array(kx)))};
  }catch(ex){return null}
}
async function dKey(kb){
  try{
    var k=await crypto.subtle.importKey("raw",b2b(kb),{name:"AES-GCM"},false,["decrypt"]);
    var p=await crypto.subtle.decrypt({name:"AES-GCM",iv:b2b(D.v)},k,b2b(D.c));
    return new TextDecoder().decode(p);
  }catch(ex){return null}
}
function go(h){document.open();document.write(h);document.close()}
var ck=sessionStorage.getItem(SK);
if(ck)dKey(ck).then(function(h){if(h)go(h);else sessionStorage.removeItem(SK)});
document.getElementById("f").addEventListener("submit",async function(ev){
  ev.preventDefault();
  var now=Date.now();
  if(now<lu){
    document.getElementById("e").textContent="Locked. Retry in "+Math.ceil((lu-now)/1000)+"s.";
    document.getElementById("e").className="e on";return;
  }
  var btn=document.getElementById("btn");
  btn.disabled=true;
  btn.innerHTML='<span class="sp"></span>Decrypting…';
  var r=await dec(document.getElementById("pw").value);
  if(r){sessionStorage.setItem(SK,r.k);go(r.h)}
  else{
    fa++;
    if(fa>=5){lu=Date.now()+60000;fa=0;document.getElementById("e").textContent="Too many attempts. Locked 60s.";document.getElementById("h").textContent=""}
    else{document.getElementById("e").textContent="Incorrect passphrase.";document.getElementById("h").textContent=(5-fa)+" attempt"+(5-fa!==1?"s":"")+" remaining"}
    document.getElementById("e").className="e on";
    btn.disabled=false;btn.textContent="Unlock";
    document.getElementById("pw").value="";document.getElementById("pw").focus();
  }
});
